import { useEffect, useState } from "react";
import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import Table from "react-bootstrap/Table";
import Button from "react-bootstrap/Button";
import Form from "react-bootstrap/Form";
import { useNavigate } from "react-router-dom";

const Dashboard = () => {
    const [employees, setEmployees] = useState([]); // Initialize employee list
    const [searchQuery, setSearchQuery] = useState(""); // For search input
    const [isSearching, setIsSearching] = useState(false); // For showing if a search is in progress
    const navigate = useNavigate();

    // Fetch employees by name whenever searchQuery changes
    useEffect(() => {
        if (searchQuery) {
            fetchEmployeesByName(searchQuery); // Fetch employees matching the search query
        } else {
            setEmployees([]); // Clear the employee list if searchQuery is empty
        }
    }, [searchQuery]);

    // Fetch employees from the backend based on search query
    const fetchEmployeesByName = async (name) => {
        setIsSearching(true); // Indicate that a search is in progress
        try {
            const response = await fetch(
                `http://localhost:8080/api/employees/details?name=${name}`
            );

            // Check if response is okay
            if (!response.ok) {
                throw new Error("Network response was not ok");
            }

            const data = await response.json();
            console.log("API Response:", data); // Log the API response

            if (data && data.content && Array.isArray(data.content)) {
                setEmployees(data.content); // Access the content property
            } else {
                setEmployees([]); // If no data, set employees to an empty array
            }
        } catch (error) {
            console.error("Error fetching employees:", error.message);
            alert("Error fetching employee data. Please try again."); // Inform the user about the error
            setEmployees([]); // If error occurs, set employees to an empty array
        } finally {
            setIsSearching(false); // Search is complete
        }
    };

    // Handle deleting an employee
    const handleDelete = async (employeeId) => {
        try {
            const response = await fetch(`http://localhost:8080/api/employees/${employeeId}`, {
                method: "DELETE",
            });
            if (response.ok) {
                fetchEmployeesByName(searchQuery); // Refresh employee list after deletion
                console.log(`Employee with ID ${employeeId} deleted successfully`);
            } else {
                alert("Failed to delete employee. Please try again.");
            }
        } catch (error) {
            console.log("Error deleting employee:", error.message);
            alert("Error deleting employee. Please try again."); // Inform the user about the error
        }
    };

    // Handle updating an employee
    const handleUpdate = (employeeId) => {
        navigate(`/employee/${employeeId}`);
    };

    return (
        <Container className="mt-5">
            <Row>
                <Col>
                    <h1 className="text-center">Employee Details by Name</h1>

                    {/* Search bar */}
                    <Form.Control
                        type="text"
                        placeholder="Enter employee name"
                        value={searchQuery}
                        onChange={(e) => setSearchQuery(e.target.value)} // Update searchQuery state on change
                        className="mb-3"
                    />

                    {/* Loading Spinner */}
                    {isSearching && <p>Loading...</p>}

                    {/* Employee table */}
                    <Table striped bordered hover responsive>
                        <thead>
                            <tr>
                                <th>ID</th>
                                <th>Name</th>
                                <th>Email</th>
                                <th>Phone</th>
                                <th>Department</th> {/* Added department column */}
                                <th>Action</th>
                            </tr>
                        </thead>
                        <tbody>
                            {employees.length > 0 ? (
                                employees.map((employee) => (
                                    <tr key={employee.id}>
                                        <td>{employee.id}</td>
                                        <td>{employee.name}</td>
                                        <td>{employee.email}</td>
                                        <td>{employee.phone}</td>
                                        <td>{employee.department}</td> {/* Displaying department */}
                                        <td>
                                            <Button variant="outline-warning" onClick={() => handleUpdate(employee.id)}>
                                                Update
                                            </Button>{" "}
                                            <Button variant="outline-danger" onClick={() => handleDelete(employee.id)}>
                                                Delete
                                            </Button>
                                        </td>
                                    </tr>
                                ))
                            ) : (
                                <tr>
                                    <td colSpan="6" className="text-center"> {/* Adjusted colspan for new column */}
                                        No employees found
                                    </td>
                                </tr>
                            )}
                        </tbody>
                    </Table>
                </Col>
            </Row>
        </Container>
    );
};

export default Dashboard;
